        search for charginos and neutralinos at the Large Hadron Collider is reported
        using fully hadronic final states and missing transverse momentum. Pair-produced
        charginos or neutralinos are explored, each decaying into a high-$p_{\\text{T}}$
        Standard Model weak boson. Fully-hadronic final states are studied to exploit
        the advantage of the large branching ratio, and the efficient background rejection
        by identifying the high-$p_{\\text{T}}$ bosons using large-radius jets and
        jet substructure information. An integrated luminosity of 139 fb$^{-1}$ of
        proton-proton collision data collected by the ATLAS detector at a center-of-mass
        energy of 13 TeV is used. No significant excess is found beyond the Standard
        Model expectation. The 95% confidence level exclusion limits are set on wino
        or higgsino production with varying assumptions in the decay branching ratios
        and the type of the lightest supersymmetric particle. A wino (higgsino) mass
        up to 1060 (900) GeV is excluded when the lightest SUSY particle mass is below
        400 (240) GeV and the mass splitting is larger than 400 (450) GeV. The sensitivity
        to high-mass wino and higgsino is significantly extended compared with the
        previous LHC searches using the other final states.","access_urls":{"links":{"csv":"https://www.hepdata.net/download/submission/ins1906174/3/csv","json":"https://www.hepdata.net/download/submission/ins1906174/3/json","root":"https://www.hepdata.net/download/submission/ins1906174/3/root","yaml":"https://www.hepdata.net/download/submission/ins1906174/3/yaml","yoda":"https://www.hepdata.net/download/submission/ins1906174/3/yoda"}},"analyses":[{"analysis":"https://www.hepdata.net/record/resource/3458718?landing_page=true","filename":"FullLikelihood_forHEPData.tar","type":"HistFactory"},{"analysis":"https://smodels.github.io/docs/ListOfAnalyses#ATLAS-SUSY-2018-41","type":"SModelS"}],"arxiv_id":"arXiv:2108.07586","collaborations":["ATLAS"],"control_number":"104458","creation_date":"2021-08-17","data_abstract":"","doc_type":"publication","doi":"10.1103/PhysRevD.104.112010","first_author":{"affiliation":"Marseille,
